import React from "react";
import { Link } from "react-router-dom";
import { connect } from "react-redux";

const Header = () => {
  const postSignout = async () => {
    await this.props.doLogout();
    const isLogin = this.props.logout;
    if (!isLogin) {
      this.props.history.push("/");
    }
  };
  return (
    <div>
      <nav
        className="navbar navbar-expand-lg navbar-light bg-dark"
        style={{
          backgroundColor: "AliceBlue",
        }}
      >
        <a>
          <img
            src={require("../media/logo192.png")}
            className="navbar-brand App-logo"
            style={{ width: "40px", height: "50px" }}
          />
        </a>
        <a>
          <h2 style={{ color: "aqua" }}>Movie</h2>
        </a>

        <button
          className="navbar-toggler"
          type="button"
          data-toggle="collapse"
          data-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>

        <div
          style={{
            fontWeight: "bolder",
          }}
          className="collapse navbar-collapse"
          id="navbarSupportedContent"
        >
          <ul className="navbar-nav mr-auto">
            <li className="nav-item ">
              <a className="nav-link" to="/" style={{ color: "white" }}>
                {" "}
                Home <span className="sr-only">(current)</span>
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" to="/profile" style={{ color: "white" }}>
                {" "}
                Profile <span className="sr-only">(current)</span>
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" to="/signin" style={{ color: "white" }}>
                {" "}
                Login <span className="sr-only">(current)</span>
              </a>
            </li>
          </ul>
        </div>
      </nav>
    </div>
  );
};

export default Header;
